            if (numbers[i] > max) {
                max = numbers[i];
            }
            else if (numbers[i] < min) {
                min = numbers[i];
            }
        }

        double[] result = new double[numbers.length];
        for (int i = 0; i < numbers.length; i += 1) {
            result[i] = (numbers[i] - min) / (max - min);
        }
        return result;
    }
}


